	public String getProductName() {
		if(productDontCare!=null) {
			return productDontCare;
		}
		return productName;
	}
	
	
	public void setProductRegistryPath(String path) {
		productRegistryPath = path;
	}
	
	
	public String getProductRegistryPath() {
		return productRegistryPath;
	}	
	
	public String getSerialNumber() {
		
		String serialString = productSerial;
		if(productDontCare!=null) {
			serialString = productDontCare;
		}
		serialString = serialString.replaceAll("[^0-9]", "");
		serialString = new String((new BigInteger(serialString)).toByteArray());
		
		return serialString;
	}
	
	
